import React from 'react';
import './App.css';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="main-content">
        <div className="left-column">
          {/* 左侧内容区域 */}
          <p>左侧70%区域内容</p>
        </div>
        <div className="divider"></div>
        <div className="right-column">
          {/* 右侧内容区域 */}
          <p>右侧30%区域内容</p>
        </div>
      </div>
    </div>
  );
}

export default App;
